INSERT INTO `platillos` (`id`, `nombre`, `precio`, `descripcion`, `imagen`) VALUES
(1, 'Pique Macho', '40.00', 'Es un plato típico de la región del altiplano, que consiste en carne de res en tiras, acompañada de salchichas, papas fritas, cebolla, ají, pimientos y salsa picante.', );
INSERT INTO `platillos` (`id`, `nombre`, `precio`, `descripcion`, `imagen`) VALUES
(2, 'Sopa de Maní', '20.00', 'Una sopa espesa hecha con maní molido, carne de res o pollo, verduras como zanahoria y papas, y un toque de especias. Es muy nutritiva y se sirve comúnmente como primer plato.', );
INSERT INTO `platillos` (`id`, `nombre`, `precio`, `descripcion`, `imagen`) VALUES
(3, 'Ceviche de Trucha', '30.00', 'Plato fresco de la región andina, hecho con trucha cruda, marinada en jugo de limón, cebolla, ají y especias. Se sirve frío con un toque de cilantro fresco.', );
INSERT INTO `platillos` (`id`, `nombre`, `precio`, `descripcion`, `imagen`) VALUES
(4, 'Chairo', '20.00', 'Una sopa tradicional del altiplano boliviano, preparada con carne de cordero o res, papas, chuño (papa deshidratada), zanahoria y condimentos. Es muy reconfortante en días fríos.', ),
(5, 'Anticuchos', '14.00', 'Brochetas de carne, típicamente de corazón de res, marinadas en una salsa de ají y especias, luego asadas a la parrilla. Se sirven con papas y una salsa picante.', );
INSERT INTO `platillos` (`id`, `nombre`, `precio`, `descripcion`, `imagen`) VALUES
(6, 'Lomo a la Criolla', '40.00', 'Carne de res a la parrilla, acompañada con una salsa criolla hecha con cebolla, pimientos, tomates y especias. Se sirve con arroz o papas.', );
INSERT INTO `platillos` (`id`, `nombre`, `precio`, `descripcion`, `imagen`) VALUES
(7, 'Kusillo', '15.00', 'Un plato tradicional de la región del oriente, hecho con carne de cerdo, que se sirve con arroz, ensalada y yuca o plátano frito.', );
INSERT INTO `platillos` (`id`, `nombre`, `precio`, `descripcion`, `imagen`) VALUES
(8, 'Fricase', '30.00', 'Plato originario de Cochabamba, hecho con carne de cerdo o pollo, que se cocina con una salsa espesa a base de chuño, papas, y maíz. Suele ser acompañado con llajwa (salsa de ají).', );
INSERT INTO `platillos` (`id`, `nombre`, `precio`, `descripcion`, `imagen`) VALUES
(9, 'Papas Rellenas', '15.00', 'Papas cocidas rellenas de carne molida, huevo, aceitunas y condimentos, luego empanadas y fritas. Acompañadas con una salsa picante o mayonesa.', );
INSERT INTO `platillos` (`id`, `nombre`, `precio`, `descripcion`, `imagen`) VALUES
(10, 'Charque de Llama', '18.00', 'Un plato simple y delicioso, hecho con mote (maíz cocido) acompañado de queso fresco, y a menudo servido con un toque de ají y cebolla.', );
INSERT INTO `platillos` (`id`, `nombre`, `precio`, `descripcion`, `imagen`) VALUES
(11, 'Chicharrón de Pollo', '25.00', 'Pollo frito crujiente, acompañado con una salsa de mostaza, y generalmente servido con arroz, papas y ensalada.', );

